function print_pdf(){
   // initialize jspdf object
   var doc = new jsPDF();
   var imgData ='data:image/png;base64,';
//    var content = document.getElementById('content') ;
   var title = document.getElementById('record_title');
    // add image on header
    doc.addImage(imgData, 'PNG', 14, 10, 182, 35);
   // use html selector
   doc.autoTable({
       margin: {top: 60,bottom:50},
       html : '#my_table'
   });

   doc.autoTable({
       html : '.another_table'
   });

    // add another html content
   doc.fromHTML(title, 15,50,{
       styles: {fillColor:[178,68,13]}
   }) ;
//    doc.fromHTML(content, 10,500);
   
   // now save pdf document
   doc.save('example1.pdf');    
}